import { Container, Typography } from "@mui/material";
import React from "react";

const Todolist = () => {
  return (
    <Container>
      <Typography variant="h3" component="h3" color="primary">
        Hello World!
      </Typography>
    </Container>
  );
};

export default Todolist;
